import { Vue } from "vue-class-component";

export default class TestComponent extends Vue {
  /** テストメッセージ */
  private testMsg = "";

  /**
   * テストボタン押下処理
   *
   * @param e
   */
  private testButtonClick(e: Event) {
    this.testMsg = this.testMsg === "" ? "★" : "";
  }
}
